script: |
  super -f text -I q12695.spq | sort > q12695.out

inputs:
  - name: q12695.spq
    data: |
      SELECT + - col1 / - 64 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + col0 + - 56 + - col0 * - col0 IN ( + - col1, + 19, - col2 / - - 96 + - col1, - + ( + col2 ) + col0 );
  - name: tab2

outputs:
  - name: q12695.out
    data: |
      0
      1
      1
